import { Grid, List, ListItemButton, ListItemIcon, ListItemText, Typography } from "@mui/material";
import LocationOnIcon from '@mui/icons-material/LocationOn';
import CallIcon from '@mui/icons-material/Call';
import MailIcon from '@mui/icons-material/Mail';
import { leftContactCard, styledListButton } from "../../styles/contact";


export default function  ContactCard() {

    return(
        <Grid container display='flex'>
            <Grid item sm={12} md={4} sx={leftContactCard}>
                <Typography variant="h4" mb={1}>Contact Information</Typography>
                <Typography variant="description">Fill up the form and our Team will get back to you within 24 hours.</Typography>
                <List>
                    <ListItemButton sx={styledListButton}>
                        <ListItemIcon><LocationOnIcon/></ListItemIcon>
                        <ListItemText>832 Thompson Drive, San Fransisco CA 94107, United States</ListItemText>
                    </ListItemButton>
                </List>
                </Grid>
            <Grid item 
                sm={12}
                md={8}
            
            ><h1>Right CArd</h1></Grid>
        </Grid>
    )

};
